:::{.callout-tip}
## Objective   

Every time I build a new report I want to put something in programatically-generated tabs.  Every time, I have to dig old code somewhere because I don't remember how I did it last time.  With the move the quarto (I'm 2 years late), I decided to try and save it all in the same spot.  

Here is my guide on how to add  the following type of outputs inside tabsets in quarto:   
  * knitr::kable()  
  * gt::gt()   
  * datatable::DT()  
  * ggplot2   
  * plotly::ggplotly()   
  * leaflet::leaflet()  
  * mapview::mapview()    

Do click the </> icon next to the title to jump to the source code on github.  
:::


::: {.cell}

:::



## kable    

kable needs to be wrapped inside print().

::: {.panel-tabset}


```{.r .cell-code}
for(i  in as.character(levels(penguins$island))) {
  cat(  glue::glue("### kable {i}   \n\n"))
  cat("\n \n")

  print(
    penguins %>%
      filter(island == i) %>%
      head(5) %>%
      knitr::kable()
  )
  cat(' \n \n')
}
```

