## gt     

gt needs to be wrapped inside print(tagList()).

::: {.panel-tabset}


```{.r .cell-code}
for(i  in as.character(levels(penguins$island))) {
  cat(  glue::glue("### gt {i}   \n\n"))
  cat("\n \n")

  print(
    tagList(
      penguins %>%
        filter(island == i) %>%
        head(5) %>%
        gt::gt()
    )
  )
  cat(' \n \n')
}
```

