## ggplot    
gplot needs to be wrapped inside print().

::: {.panel-tabset}


```{.r .cell-code}
for(i  in as.character(levels(penguins$island))) {
  cat(  glue::glue("### ggplot {i}   \n\n"))
  cat("\n \n")

  print(
    penguins %>%
      filter(island == i) %>%
      ggplot(aes(x=bill_length_mm,  y= bill_depth_mm, color = species)) +
      geom_point() + 
      labs(title = i)
  )
  cat(' \n \n')
}
```

