for(i  in as.character(levels(penguins$island))) {

  mymap <-  leaflet() %>%
    addTiles()   %>% 
    setView(-93.65, 42.0285, zoom = 17)  %>%
    addPopups(-93.65, 42.0285, 'Here is the <b>Department of Statistics</b>, ISU')


  cat(  glue::glue("### leaflet {i}   \n\n"))
  cat("\n \n")

  print(tagList(mymap))

  cat(' \n \n')
}
