for(i  in as.character(levels(penguins$island))) {
  mymap <- mapview(breweries, zcol="number.of.types")
  cat(  glue::glue("### all in one {i}   \n\n"))
  cat("\n \n")

  print(
    penguins %>%
      filter(island == i) %>%
      head(5) %>%
      knitr::kable()
  )
  print(
    tagList(
      penguins %>%
        filter(island == i) %>%
        head(5) %>%
        gt::gt()
    )
  )
  print(
    penguins %>%
      filter(island == i) %>%
      ggplot(aes(x=bill_length_mm,  y= bill_depth_mm, color = species)) +
      geom_point() + 
      labs(title = i)
  )
    my_plot <- penguins %>%
    filter(island == i) %>%
    ggplot(aes(x=bill_length_mm,  y= bill_depth_mm, color = species)) +
    geom_point() + 
    labs(title = i)
  print(
    tagList(
      ggplotly(my_plot)
    )
  )
  cat(' \n \n')
}
